import React, { Component } from 'react';
import axios from 'axios'
import { withRouter } from 'react-router-dom';
import {
  isFaceDetectionModelLoaded
} from '../api/face';

const INIT_STATE = {
  url: null,
  imageURL: null,
  fullDesc: null,
  imageDimension: null,
  error: null,
  loading: false
};

class CaracteristicasFoto extends Component {
  constructor(props) {
    super(props);
    this.state = {
      ...INIT_STATE,
      faceMatcher: null,
      showDescriptors: false,
      isModelLoaded: !!isFaceDetectionModelLoaded(),
      caracteristicas: []
    };
    //this.componentDidMount();
  }

  componentDidMount() {
    axios.get('../json/caracteristicasFoto.json')
        .then(response => this.setState({ caracteristicas: response.data.data }))
  }

  renderUsers() {
    const { caracteristicas } = this.state

    return caracteristicas.map( user => (
        <div key={user.id}>{user.first_name} {user.last_name}</div>
    ))
  }

  render() {
    debugger;
    /*return <div>{ this.renderUsers() }</div>*/

    return (
        <div className="smartphone">
          <div className="content">
            <div>
              <div
                  style={{
                    position: 'relative'
                  }}
              >
                <table>
                  <tr>
                    <th>Nombre Cliente</th>
                    <th>Edad</th>
                    <th>Sexo</th>
                    <th>Estado Emocional</th>
                    <th>Fecha</th>
                  </tr>
                  <tr>
                    <td>Victor Villacorta</td>
                    <td>30</td>
                    <td>Male</td>
                    <td>Neutral</td>
                    <td>01/11/2019 11:00:01</td>
                  </tr>
                  <tr>
                    <td>Javier Cuicapuza</td>
                    <td>28</td>
                    <td>Male</td>
                    <td>Happy</td>
                    <td>01/10/2019 12:00:01</td>
                  </tr>
                  <tr>
                    <td>Jhosep Vega</td>
                    <td>36</td>
                    <td>Male</td>
                    <td>Happy</td>
                    <td>01/12/2019 18:34:01</td>
                  </tr>
                  <tr>
                    <td>Jonathan Quiza</td>
                    <td>27</td>
                    <td>Male</td>
                    <td>Neutral</td>
                    <td>01/11/2019 15:00:01</td>
                  </tr>
                  <tr>
                    <td>Rosa Soto</td>
                    <td>27</td>
                    <td>Female</td>
                    <td>Happy</td>
                    <td>15/12/2019 11:00:01</td>
                  </tr>
                </table>
              </div>

            </div>
          </div>
        </div>
    );
  }
}

export default withRouter(CaracteristicasFoto);
